import {Link} from "react-router-dom";

const PRODUCTS = [
    {id: 1, name: "Product 1"},
    {id: 2, name: "Product 2"},
    {id: 3, name: "Product 3"},
];

function Products() {
    return (<>
            <h1>Some products</h1>
            <ul>
                {PRODUCTS.map(product => (
                    <li key={product.id}>
                        <Link to={product.id} relative="">{product.name}</Link>
                    </li>
                ))}
            </ul>
        </>)
}

export default Products;
